import React from "react";
import TextField from "@material-ui/core/TextField";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";

const useStyles = makeStyles((theme) => ({
  root: {
    "& .MuiTextField-root": {
      margin: theme.spacing(1),
      width: "25ch",
    },
  },
}));

export default function FormPropsTextFields(props) {
  const classes = useStyles();
  const [state, setState] = React.useState({
    assetName: "",
    interest: 0,
    value: 0,
    data: [],
  });

  const handleNameChange = (e) => {
    setState({ assetName: e.target.value });
  };

  const handleInterestChange = (e) => {
    setState({ interestRate: e.target.value });
  };

  const handleValueChange = (e) => {
    setState({ currentValue: e.target.value });
  };

  const addAsset = (e) => {
    const newAsset = [state.assetName, state.interest, state.value];
    // props.onChange(newAsset);
    //const newList = [...data, newAsset];
    // setState({
    //   data: [...state.data, { newAsset }],
    // });

    console.log(state.data);
  };

  return (
    <form className={classes.root} autoComplete="off">
      <div>
        <TextField
          id="asset_name"
          label="Asset Name"
          variant="outlined"
          //value={assetName}
          onChange={handleNameChange}
        />

        <TextField
          id="interest_rate"
          label="Asset Interest Rate"
          type="number"
          variant="outlined"
          step={0.1}
          //value={interestRate}
          onChange={handleInterestChange}
        />
        <input
          id="current_value"
          label="Current Value"
          type="number"
          variant="outlined"
          min = "0"
          step= "1000"
          //value={currentValue}
          onChange={handleValueChange}
        />
        <Button variant="contained" color="primary" onClick={addAsset} >
          Add this asset
        </Button>
      </div>
    </form>
  );
}
